function Tieude() {
  return (
    <>
      <div className="td_title">
        <i className="fas fa-chart-line fa-2x" style={{ color: 'blue' }} />
        <div className="title">
          <a href>Xu hướng</a>
        </div>
      </div>
    </>
  );
}
export default Tieude;
